const tableElement = document.querySelector("table")

const allRecent = document.querySelectorAll('.spelatLagar')
allRecent.forEach((e) => {

    let randomzierfix = 0; 
    const result = e.querySelector(".divider")
    result.innerHTML = `${Math.floor(Math.random() * 8)} : ${Math.floor(Math.random() * 8)}`
    for (let i = 0; i < 2; i++ ) {
        let randomNumber = Math.floor(Math.random() * 12)
        if (randomNumber === randomzierfix) {
            randomNumber = Math.floor(Math.random() * 12)
        }
        randomzierfix = randomNumber
        const TeamSelected = teams[randomNumber]
        const createTeamPlace = document.createElement("div")
        createTeamPlace.setAttribute("class", "teamsPlayed")
        createTeamPlace.innerHTML = `<img src="${TeamSelected.img}"/> <br> <h2>${TeamSelected.team}</h2>`

        e.appendChild(createTeamPlace)

    }
})

const observer = new IntersectionObserver((element) => {

    element.forEach((e) => {
        if (e.isIntersecting) {
            e.target.style.opacity = "1"
        } else {
            e.target.style.opacity = "0"
        }
    })
})

const explainSection = document.querySelectorAll(".forklaring")
explainSection.forEach(e => {
    observer.observe(e)
})


sortedTeams.forEach((item, index)  => {
    const newRow = document.createElement("tr")
    const newTd = document.createElement("td")
    newTd.innerHTML = index+1
    newRow.append(newTd)
    for(let i = 0; i < 8; i++) {
        const newTd = document.createElement("td")

        if (allSections[i] === "img") {          
            const takeId = document.querySelector("#LagNamn")
            const img = item[allSections[i]]

        } else if (allSections[i] === "team"){
            newTd.innerHTML = `<h2>${item[allSections[i]]}</h2> <img src=${item[allSections[i+1]]} />`
            newTd.setAttribute("id", "LagNamn")

            newRow.appendChild(newTd)

        } else {
            newTd.innerHTML = item[allSections[i]]
            newTd.setAttribute("class", "values")
            newRow.appendChild(newTd)
        }
    }
    tableElement.appendChild(newRow)
})

